/*Table structure for table `bbgshop_bargain` */

DROP TABLE IF EXISTS `bbgshop_bargain`;

CREATE TABLE `bbgshop_bargain` (
  `id` int(8) NOT NULL AUTO_INCREMENT COMMENT '砍价id、',
